import React, { useEffect, useState } from 'react';
import Axios from 'axios';

const LoginPage = () => {

    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const login = () => {
        Axios.post('https://localhost:3001', {
            username: username,
            password: password,
        }).then(response => {
            console.log(response);
        });
    };

    return (
        <div style={{
            background: 'rgba(29, 29, 35, 1)',
        }}>
            <div className="container-fluid px-5" style={{
                paddingTop: '5rem',
                paddingBottom: '1rem'
            }}>
                <h1>login</h1>
                <form className="container-fluid py-3" style={{
                    backgroundColor: 'rgba(80, 80, 100, 1)',
                    borderRadius: '3px',
                }}>
                <div className="mb-3">
                    <label htmlFor="exampleInputUsername1" className="form-label text-white">Username</label>
                    <input type="username" className="form-control" id="exampleInputUsername1" aria-describedby="usernameHelp"
                        onChange={(e) => {
                            setUsername(e.target.value);
                        }}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="exampleInputPassword1" className="form-label text-white">Password</label>
                    <input type="password" className="form-control" id="exampleInputPassword1"
                        onChange={(e) => {
                            setPassword(e.target.value);
                        }}
                    />
                </div>
                <div className="mb-3 form-check">
                    <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
                    <label className="form-check-label text-white" htmlFor="exampleCheck1">Check me out</label>
                </div>
                <button type="submit" className="btn-login"
                    onClick={login}
                >Login</button>
                </form>

            </div>
        </div>
    )
}

export default LoginPage;
